import { __decorate } from "tslib";
import { Component } from '@angular/core';
let VideojocsMostPopularComponent = class VideojocsMostPopularComponent {
    constructor(videojocsService) {
        this.videojocsService = videojocsService;
        this.listaSeriesVideojocs = [];
    }
    ngOnInit() {
        this.loadSeriesVideojocs();
    }
    async loadSeriesVideojocs() {
        const seriesVideojocs = await this.videojocsService.listarSeriesVideojocs();
        this.listaSeriesVideojocs = seriesVideojocs.results;
        console.log(seriesVideojocs.results);
    }
};
